import { useState, useRef } from "react";
import Lottie from "lottie-react";
import { motion } from "framer-motion";
import t1 from "./t1.json";
import t2 from "./t2.json";
import i1 from "./img1.jpg";
import i2 from "./img2.jpg";
import i3 from "./img3.jpg";
import i4 from "./img4.jpg";
import i5 from "./img4.jpg";

const SequentialLottie = ({ onComplete }) => {
    const [showSecond, setShowSecond] = useState(false);
    const [isSecondStarted, setIsSecondStarted] = useState(false); // 두 번째 애니메이션이 한 번이라도 실행됐는지 여부
    const firstLottieRef = useRef(null);

    return (
        <div className="flex flex-col items-center">
            {/* 첫 번째 애니메이션 */}
            <Lottie
                lottieRef={firstLottieRef}
                animationData={t1}
                loop={false}
                onComplete={() => setShowSecond(true)} // 첫 번째 애니메이션이 끝나면 두 번째 애니메이션 실행
            />

            {/* 두 번째 애니메이션: 첫 번째가 끝난 후 실행됨 (무한 루프) */}
            {showSecond && (
                <Lottie
                    animationData={t2}
                    loop={true} // ❗ 무한 반복
                    onLoopComplete={() => setIsSecondStarted(true)} // 첫 루프가 끝나면 motion.div 표시
                />
            )}

            {/* 두 번째 애니메이션이 한 번이라도 실행되면 motion.div 표시 */}
            {isSecondStarted && (
                <motion.div
                    initial={{opacity: 0, x: 50}}
                    animate={{opacity: 1, x: 0}}
                    transition={{
                        ease: "easeInOut",
                        duration: 2,
                        x: {duration: 1},
                    }}
                    className="flex flex-col items-center w-full" // ✅ motion.div에 w-full 추가!
                >
                    <p>세상에서 가장 소중한 가은아, 생일 정말 정말 축하해! 🥳🎂🎉</p>
                    <p>벌써 내가 자기 생일을 3번이나 챙겨줬네~! 시간이 너무 빨라?!</p>
                    <p>특히 이번에는 선물 고르는게 너무 어려웠어,,,, 그래서 고민하고 고민하다가 자기가 팔찌가 없는거 같아서 한번 골라봤습니당..!</p>
                    <p>오늘은 자기를 행복하게 해주고 싶어서 나도 어떻게 해줄까 고민을 많이 해보고 준비해본건데 (선물은 조금 마음에 안들지만...) 그래도
                        자기랑 앞으로도 계속 지금처럼만 행복하게 지내면 너무 좋을것같아! 우리가 만난지 벌써 834일이나 됐다?!
                        자기 처음 만났을때는 머리가 엄청 짧고 노랬는데
                    </p>
                    <img src={i1} alt="1" style={{width: "50%", height: "50%"}}/>
                    <p>지금은 이렇게 길렀네??</p>
                    <img src={i4} alt="1" style={{width: "50%", height: "50%"}}/>
                    <p>속초도 놀러가구</p>
                    <img src={i2} alt="1" style={{width: "50%", height: "50%"}}/>
                    <p>코타키나발루도 놀러가구</p>
                    <img src={i3} alt="1" style={{width: "50%", height: "50%"}}/>
                    <p>제천도 놀러가구</p>
                    <img src={i5} alt="1" style={{width: "50%", height: "50%"}}/>
                    <p>여기저기 많이 다녔어!</p>
                    <p>생각해보면 지금까지 내가 행복했던 순간의 대부분은 자기랑 같이 보내왔던거 같아! 그래서 너무 너무 좋아! 그리고 내가 힘들때도 자기가 항상 가장 먼저 위로해줘서 너무 너무
                        고마웠어! 그래서 나는 아마 자기가 없었으면 많이 불행한 사람이었을거야,,ㅎㅎ</p>
                    <p></p>
                </motion.div>

            )}
        </div>
    );
};

export default SequentialLottie;
